package org.example.sbexa.controller;

import com.somp.server.sdk.Client;
import com.somp.server.sdk.constants.Constants;
import com.somp.server.sdk.exception.SompException;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RestController;

import javax.annotation.PostConstruct;
import java.util.HashMap;
import java.util.Map;

@RestController
public class IamTestController {

    private static Logger logger = LoggerFactory.getLogger(IamTestController.class);

    @PostConstruct
    public void postConstruct(){
        try {
            Client.init();
            logger.info("初始化成功!");
        } catch (SompException e) {
            e.printStackTrace();
            logger.info("初始化失败!");
        }
    }

    @GetMapping(value = "/twoElements")
    public String twoElements() {

        try {
            Map<String, String> map = new HashMap<>();
            map.put(Constants.ReqParams.VL, Constants.VL_2);

            Client.getDefaultParam(map);

            // I1004
            map.put("userName", "赵雷");
            map.put("idNumber", "220282199407072610");

            Client.getDealParam(map);
            // 生产环境环境
            String response = Client.sendMsgByPost("https://smhypt.asiainfo-sec.com:8443", "I1004", map);
            logger.info("response = " + response);

        } catch (SompException e) {
            e.printStackTrace();
        }

        return "{'code':'200', 'info':'success'}";
    }

    @GetMapping(value = "/twoElementsPhoto")
    public String twoElementsPhoto() {

        try {
            Map<String, String> map = new HashMap<>();
            map.put(Constants.ReqParams.VL, Constants.VL_2);

            Client.getDefaultParam(map);

            // I1005
            map.put("userName", "王宏");
            map.put("idNumber", "41152119911004191X");
            map.put("personPhoto", "");

            Client.getDealParam(map);
            // 生产环境环境
            String response = Client.sendMsgByPost("https://smhypt.asiainfo-sec.com:8443", "I1005", map);
            logger.info("response = " + response);

        } catch (SompException e) {
            e.printStackTrace();
        }

        return "{'code':'200', 'info':'success'}";
    }


}
